import React from "react";

function Footer() {
  return (
    <div>
      <footer
        className="text-center"
        style={{ backgroundColor: "rgb(248,249,250)" }}
      >
        <div className="text-center p-3">&copy; 2021</div>
      </footer>
    </div>
  );
}

export default Footer;
